import React from "react";
import styled from 'styled-components'
import BurguerButton from "./BurguerButton";

function Navbar(){

    return(
        <>
            <NavContainer>
                <h2>Hamburguer <span>menu</span></h2>
                <div className="links active">
                    <a href="/">Home</a>
                    <a href="/">About us</a>
                    <a href="/">Shop</a>
                    <a href="/">Call us</a>
                    <a href="/">Blog</a>
                </div>
                <div className="burguer">
                    <BurguerButton/>
                </div>

            </NavContainer>

        </>
    )
}

export default Navbar

const NavContainer = styled.nav`
    h2{
        color: white;
        font-weight: 400;
        span{
        font-weight: bold;
        }
    }

    padding: .4rem;
    background-color: #333;
    display: flex;
    align-items: center;
    justify-content: space-between;

    a{
        color: white;
        text-decoration: none;
        margin-right: 1rem;
    }

    .links{
        position:absolute;
        top: -700px;
        left: -2000px;
        margin-left: auto;
        margin-right: auto;
        text-align: center;

        a{
            color: #333;
            font-size: 2rem;
            display: block;
        }
        @media(min-width: 768px){

        }
    }

    .links.active{
        width: 100%;
        display: block;
        position: absolute;
        margin-left: auto;
        margin-right: auto;
        top: 30%;
        left: 0;
        right: 0;
        text-align: center;

        a{
            color: #333;
        }

    }

    .burguer{
        @media(min-width: 768px){
            display: none;
        }
    }
`
